INSERT INTO `configminijobstaskssettings` VALUES (10,'Description','\"Was, wer sind Sie?! Ach Sie sind die Putze! Haben Sie auch endlich zu uns gefunden, das hat ja gar keine Ewigkeit gedauert. Gehen Sie direkt zu Bob, der erklärt Ihnen alles. Na los, brauchen Sie noch eine extra Einladung, ich habe ein wichtiges Telefonat!\"'),(10,'Name','Organisatorin Karen'),(11,'Description','\"Ach du bist die arme Seele, Karen ging dir sicher auch auf die Nerven. Die ist heute aber auch wieder gestresst. Aber davon müssen wir uns ja nicht stressen lassen. Wo du anfangen kannst? Lass mich überlegen, was zu tun ist... Ach ja, sammel am besten zuerst den Müll hier auf. Schau dich einfach um und räum weg, was den Ort hier dreckig aussehen lässt.\"'),(11,'Name','Hausmeister Bob'),(12,'AllCollectables','[{\"Name\":\"Müll\",\"ColShapeStr\":\"{\\\"X\\\":-2270.1948,\\\"Y\\\":271.83572,\\\"Z\\\":174.55484}#3.0#3.0#0.0#true#false#true\",\"PropName\":\"prop_rub_litter_03c\",\"PropPosition\":{\"X\":-2270.1948,\"Y\":271.83572,\"Z\":173.55484},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.2617994},\"AnimIdentifier\":\"REMOVE_PLANT\",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true},{\"Name\":\"Müll\",\"ColShapeStr\":\"{\\\"X\\\":-2233.59,\\\"Y\\\":263.8804,\\\"Z\\\":174.6095}#3.0#3.0#0.0#true#false#true\",\"PropName\":\"prop_rub_litter_03b\",\"PropPosition\":{\"X\":-2233.59,\"Y\":263.8804,\"Z\":173.5686},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"REMOVE_PLANT\",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true},{\"Name\":\"Müll\",\"ColShapeStr\":\"{\\\"X\\\":-2211.271,\\\"Y\\\":207.32681,\\\"Z\\\":174.59265}#3.0#3.0#0.0#true#false#true\",\"PropName\":\"prop_rub_litter_03c\",\"PropPosition\":{\"X\":-2211.271,\"Y\":207.32681,\"Z\":173.56856},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":-0.95993125},\"AnimIdentifier\":\"REMOVE_PLANT\",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true},{\"Name\":\"Müll\",\"ColShapeStr\":\"{\\\"X\\\":-2244.5576