ne in den Gärten der Nachbarn herum. So langsam glaube ich, dass die Nachbarn die Bären heimlich füttern, sodass sie keinen Hunger haben und nicht mehr nach Hause kommen. Solltest du auf dem Weg die Nachbarn sehen, dann sag ihnen mal, dass die Bären nicht mehr gefüttert werden sollen. Die Bären kannst du leicht erkennen, da alle gleich aussehen. Du kannst sie auch gerne rufen; die Namen lauten Felix, Irma, Mimi, Keks und Schnucki.'),(89,'Name','Oma Gertrude'),(89,'RequiredCollects','5'),(89,'SelectedCollects','7'),(90,'AllOptions','[{\"ItemId\":14,\"MinAmount\":3,\"MaxAmount\":10}]'),(90,'Description','Da bist du ja wieder. Wieso hast du mir Teddybären gebracht? Ich wollte meine Katzen wiederhaben. Meine Tochter meinte, sie seien schon lange gestorben, aber ich glaube ihr nicht. Naja, ich habe jetzt einen anderen losgeschickt. Du kannst mir stattdessen einen anderen Gefallen tun. Ich brauche unbedingt frische Äpfel, da meine alten auf seltsame Weise verschwunden sind. Bitte besorge mir welche.'),(90,'Name','Oma Gertrude'),(90,'SelectedAmount','1'),(91,'AllCollectables','[{\"Name\":\"Blume\",\"ColShapeStr\":\"{\\\"X\\\":1065.9233,\\\"Y\\\":-382.7801,\\\"Z\\\":66.14136}#3.0#3.0#0.0#true#false#true\",\"PropName\":\"vw_prop_flowers_vase_02a\",\"PropPosition\":{\"X\":1065.9233,\"Y\":-382.7801,\"Z\":66.94566},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"PICK_UP\",\"IsShownOnMap\":true,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false},{\"Name\":\"Blume\",\"ColShapeStr\":\"{\\\"X\\\":1032.1947,\\\"Y\\\":-415.21954,\\\"Z\\\":65.61902}#3.0#3.0#0.0#true#false#true\",\"PropName\":\"vw_prop_flowers_vase_02a\",\"PropPosition\":{\"X\":1032.1947,\"Y\":-415.21954,\"Z\":64.999435},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"PICK_UP\",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false},{\"Name\":\"Blume\",\"ColShapeStr\":\"{\\\"X\\\":1010.87354,\\\"Y\\\":-429.06247,\\\"Z\\\":6