\"Y\\\":865.3099,\\\"Z\\\":196.76709}#13.0#14.0#0.0#true#false#true\",\"Name\":\"Ententeich\",\"InfosSelectAmount\":1,\"AllInfos\":[{\"Description\":\"Wasser\",\"Options\":[\"Kalt\",\"Warm\"]}]},{\"ColShapeStr\":\"{\\\"X\\\":1101.3231,\\\"Y\\\":-559.8989,\\\"Z\\\":55.73401}#11.0#20.0#0.0#true#false#true\",\"Name\":\"Mirror Park \",\"InfosSelectAmount\":1,\"AllInfos\":[{\"Description\":\"Wasser\",\"Options\":[\"Kein Badesee\"]}]}]'),(92,'AmountInfosSelected','3'),(92,'AmountSpotsSelected','3'),(92,'Description','Die Blumen haben optisch nicht zur Dekoration gepasst und landeten danach im Müll. Ich denke, dass du keine Ahnung von Dekoration hast, daher lasse ich dich lieber etwas überprüfen, anstatt mir nochmal etwas zu holen. Mein Nachbar Günther möchte später noch mit mir schwimmen gehen, wo das Wasser am wärmsten ist. Könntest du das Wasser für mich überprüfen? Die Gewässer sind an folgenden Punkten...'),(92,'Name','Oma Gertrude'),(92,'OnlySelectedSpotsAreShown','FALSE'),(93,'Description','Hallo Fremder, ist der Norden nicht schön? Also, wenn man sich den ganzen Müll wegdenkt und nicht gerade noble Häuser erwartet. Meine neue Initiative ist, die Stadt sauberer zu machen, um vielleicht mehr Touristen anzusprechen, die ihr Geld hier lassen. Deshalb kann ich deine Hilfe gut gebrauchen.'),(93,'Name','Schwarzes Brett'),(94,'AllCollectables','[{\"Name\":\"Flaschen\",\"ColShapeStr\":\"{\\\"X\\\":1374.7885,\\\"Y\\\":3597.872,\\\"Z\\\":34.92456}#3.0#3.0#0.0#true#false#true\",\"PropName\":\"bkr_int_02_bottles_circle_table\",\"PropPosition\":{\"X\":1374.7885,\"Y\":3597.872,\"Z\":33.891552},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"PICK_UP\",\"IsShownOnMap\":true,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false},{\"Name\":\"Flaschen\",\"ColShapeStr\":\"{\\\"X\\\":1382.1552,\\\"Y\\\":3600.472,\\\"Z\\\":34.92456}#3.0#3.0#0.0#true#false#true\",\"PropName\":\"bkr_int_02_bottles_circle_table\",\"PropPosition\":{\"X\":1382.1552,\"Y\":36