 Charme ausstrahlt, was Sandy Shores ausmacht. Leider ist der alte Besitzer schon lange verstorben, und es gab nie einen Nachfolger für das gute Stück. Das Traurige ist, dass deswegen kaum noch Fremde nach Sandy Shores kommen, da die Bar sehr beliebt war und dort jeder eingekehrt ist. Der Parkplatz vor der Bar ist sehr zugewachsen mit Gras, das du jetzt entfernen darfst.'),(96,'Name','Schwarzes Brett'),(96,'RequiredCollects','8'),(96,'SelectedCollects','8'),(97,'Description','Hallo, meine Organisation sucht fleißige Helfer, denen das Wohl der Natur am Herzen liegt. Im Mirror Park haben wir eine Aufgabenliste ausgehängt, die du in der Nähe des Teiches finden kannst. Diese ist leicht zu erreichen. Dein Auto kann dir beim Erfüllen der Aufgaben eine nützliche Unterstützung sein.'),(97,'Name','Aufgabenliste'),(98,'Description','Moin, deine erste Aufgabe wird sein, die vorgegebenen Windkrafträder zu überprüfen. Ich möchte wissen, wie viel Strom sie ins Netz schon eingespeist haben. Unten an der Säule befindet sich ein kleiner Kasten, in dem sich der Zähler befindet. Damit du mir nicht mit einer Milliarden-Nummer kommst, wird es mir reichen, dass du die ersten 3 Ziffern mitteilst.'),(98,'Name','Elektriker Walden'),(99,'AllBlueprints','[{\"ColShapeStr\":\"{\\\"X\\\":2359.622,\\\"Y\\\":1508.2153,\\\"Z\\\":54.21753}#6.0#14.0#0.0#true#false#true\",\"Name\":\"Rad 22\",\"InfosSelectAmount\":1,\"AllInfos\":[{\"Description\":\"Zählerstand\",\"Options\":[\"277\",\"484\",\"792\",\"895\",\"356\",\"813\",\"518\",\"306\",\"760\",\"145\",\"206\",\"980\",\"345\",\"237\",\"285\",\"488\",\"246\",\"425\",\"379\",\"635\",\"728\",\"247\",\"809\",\"363\",\"525\",\"221\",\"681\",\"116\",\"493\",\"955\",\"483\",\"702\",\"490\",\"424\",\"414\",\"571\",\"344\",\"113\",\"810\",\"889\",\"886\",\"566\",\"680\",\"381\",\"858\",\"711\",\"845\",\"791\",\"533\",\"947\",\"641\",\"187\",\"219\",\"109\",\"286\",\"272\",\"758\",\"252\",\"466\",\"439\",\"864\",\"290\",\"743\",\"148\",\"368\",\"710\",\"768\",\