 speziellen Dünger und bitte dich, folgende Blumen zu behandeln, die ich dir mal eben auf der Karte zeige. Es handelt sich um eine sehr spezielle Art von Blumen, die eine Menge Geld kosten würden, müsste ich sie neu besorgen und einpflanzen. Deshalb entferne gleichzeitig auch die abgestorbenen Blätter.'),(131,'Name','Mrs. Cooper'),(131,'RequiredCollects','8'),(131,'SelectedCollects','8'),(132,'Description','Ey du da, bist du gekommen, um mich zu unterstützen?'),(132,'Name','Mr. Ling'),(133,'Description','Ich habe absolut keinen Bock, der Postbote für die Schauspieler zu sein. Hast du eine Ahnung, wie anstrengend das ist? Ständig kommt irgendein Bote und bringt die Fanpost, und ich bin der Depp, der sie verteilen soll. Das sehe ich nicht mehr ein. Nicht mal Trinkgeld oder gar ein Autogramm habe ich jemals erhalten. Deshalb habe ich um Unterstützung gebeten. Deine Aufgabe wird sein, die Fanpost zu verteilen. Aber fasse ja nichts an; die merken es sofort, wenn etwas nicht stimmt. Die Schauspieler sind gerade auf Probe, das bedeutet, dass du in ihren Wohnwägen ohne weiteres reingehen kannst, um die Post dort abzulegen.'),(133,'Name','Mr. Ling'),(134,'Description','Ablage für die Fanpost'),(134,'Name','Donny Jepp'),(135,'Description','Ablage für die Fanpost'),(135,'Name','Wenzel Dashington'),(136,'Description','Ablage für die Fanpost'),(136,'Name','Amela Panderson'),(137,'Description','Ablage für die Fanpost'),(137,'Name','Lady Gogo'),(138,'Description','Na hast du alles abgegen? Wen ja dann gehts gleich weiter.'),(138,'Name','Mr. Ling'),(139,'AllCollectables','[{\"Name\":\"Blumen\",\"ColShapeStr\":\"{\\\"X\\\":-1062.9525,\\\"Y\\\":-503.4169,\\\"Z\\\":36.59265}#1.0#1.0#0.0#true#false#true\",\"PropName\":\"hei_heist_acc_flowers_01\",\"PropPosition\":{\"X\":-1062.9525,\"Y\":-503.4169,\"Z\":36.490143},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":-0.0},\"AnimIdentifier\":\"PICK_UP\",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false},{\