','Mr. Ling'),(147,'Description','Hey schön, dass du da bist, ich erkläre dir mal, was das hier ist. Der LSMYC ist ein öffentlicher Freizeitclub, der für die Mittel- und Oberschicht gedacht ist. Ein am LS Marina liegendes Clubhaus, welches auch für Events oder abendliche Vergnügungen geeignet ist, bildet den zentralen Treffpunkt. Es gibt einen gewissen Dresscode, an den sich jeder Teilnehmer halten muss. Die Mitglieder müssen monatlich einen Betrag an das Vereinskonto überweisen, womit dann die Immobilie sowie die Boote finanziert werden. Letztere können dann von den Mitgliedern gechartert werden. Ebenfalls sind Events, wie Rallys, Inselumrundungen oder einfache Bootstouren möglich. '),(147,'Name','Lizzy Jones'),(148,'AllCollectables','[{\"Name\":\"Stehtisch\",\"ColShapeStr\":\"{\\\"X\\\":-835.22614,\\\"Y\\\":-1338.7585,\\\"Z\\\":4.9992676}#2.0#2.0#0.0#true#false#true\",\"PropName\":\"prop_table_07\",\"PropPosition\":{\"X\":-835.22614,\"Y\":-1338.7585,\"Z\":3.985858},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"SCREW_FRONT\",\"IsShownOnMap\":true,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false},{\"Name\":\"Stehtisch\",\"ColShapeStr\":\"{\\\"X\\\":-831.3302,\\\"Y\\\":-1352.6306,\\\"Z\\\":4.9992676}#2.0#2.0#0.0#true#false#true\",\"PropName\":\"prop_table_07\",\"PropPosition\":{\"X\":-831.3302,\"Y\":-1352.6306,\"Z\":3.9840765},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"SCREW_FRONT\",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false},{\"Name\":\"Stehtische\",\"ColShapeStr\":\"{\\\"X\\\":-825.31573,\\\"Y\\\":-1370.2246,\\\"Z\\\":4.9992676}#2.0#2.0#0.0#true#false#true\",\"PropName\":\"prop_table_07\",\"PropPosition\":{\"X\":-825.31573,\"Y\":-1370.2246,\"Z\":3.9841497},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"SCREW_FRONT\",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false},{\"Name\":\"Stehtisc