awnObjectOnInteract\":false}]'),(148,'Description','Wir hatten gestern eine Feier, bei der 2 neue Boote vom Stapel laufen konnten. Das hat für uns eine große Bedeutung, da es wie eine Taufe bei Menschen ist. Jetzt stehen allerdings überall noch die Stehtische herum. Deshalb würde ich dich gerne darum bitten, die Tische einzusammeln. Wenn ich mich nicht täusche, müssten es 8 Stück sein.'),(148,'Name','Lizzy Jones'),(148,'RequiredCollects','8'),(148,'SelectedCollects','8'),(149,'AllBlueprints','[{\"ColShapeStr\":\"{\\\"X\\\":-842.03076,\\\"Y\\\":-1308.9758,\\\"Z\\\":5.083496}#3.0#2.0#0.0#true#false#true\",\"Name\":\"Baum 1\",\"InfosSelectAmount\":1,\"AllInfos\":[{\"Description\":\"Zustand\",\"Options\":[\"gesund\",\"befallen\",\"krank\"]}]},{\"ColShapeStr\":\"{\\\"X\\\":-792.211,\\\"Y\\\":-1337.5912,\\\"Z\\\":5.100342}#3.0#2.0#0.0#true#false#true\",\"Name\":\"Baum 3\",\"InfosSelectAmount\":1,\"AllInfos\":[{\"Description\":\"Zustand\",\"Options\":[\"gesund\",\"befallen\",\"krank\"]}]},{\"ColShapeStr\":\"{\\\"X\\\":-825.1912,\\\"Y\\\":-1354.6945,\\\"Z\\\":5.100342}#3.0#2.0#0.0#true#false#true\",\"Name\":\"Baum 4\",\"InfosSelectAmount\":1,\"AllInfos\":[{\"Description\":\"Zustand\",\"Options\":[\"gesund\",\"befallen\",\"krank\"]}]},{\"ColShapeStr\":\"{\\\"X\\\":-803.03735,\\\"Y\\\":-1388.2153,\\\"Z\\\":5.100342}#3.0#2.0#0.0#true#false#true\",\"Name\":\"Baum 7\",\"InfosSelectAmount\":1,\"AllInfos\":[{\"Description\":\"Zustand\",\"Options\":[\"gesund\",\"befallen\",\"krank\"]}]},{\"ColShapeStr\":\"{\\\"X\\\":-793.2659,\\\"Y\\\":-1377.1252,\\\"Z\\\":5.100342}#2.0#2.0#0.0#true#false#true\",\"Name\":\"Baum 8\",\"InfosSelectAmount\":1,\"AllInfos\":[{\"Description\":\"Zustand\",\"Options\":[\"gesund\",\"befallen\",\"krank\"]}]},{\"ColShapeStr\":\"{\\\"X\\\":-765.54724,\\\"Y\\\":-1342.6945,\\\"Z\\\":5.437378}#2.0#3.0#0.0#true#false#true\",\"Name\":\"Baum 10\",\"InfosSelectAmount\":1,\"AllInfos\":[{\"Description\":\"Zustand\",\"Options\":[\"gesund\",\"befallen\",\"krank\"]}]}]'),(149,'AmountInfosSelected','6'),(149,'AmountSpotsSelected','6'),(149,'Description','Schön, dass es mit den Tischen so gut funktioniert hat. Der Yachtclub steht für Schönheit und Eleganz, deshalb wird er auch streng kontrolliert und gepflegt. Auf meiner Liste steht, dass wir die Bäume als nächstes überprüfen sollten, um zu schauen, ob sie gesund oder krank oder durch Blattläuse befallen sind. Überprüfe bitte die Bäume und teile mir den Zustand mit.'),(149,'Name','Lizzy Jones'),(149,'OnlySelectedSpotsAreShown','FALSE'),(150,'AllCollectables','[{\"Name\":\"Tau\",\"ColShapeStr\":\"{\\\"X\\\":-738.0859,\\\"Y\\\":-1347.6935,\\\"Z\\\":1.5955810499999998}#2.0#2.0#0.0#true#false#true\",\"PropName\":\"prop_rope_family_3\",\"PropPosition\":{\"X\":-738.0859,\"Y\":-1347.6935,\"Z\":0.63230926},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"PICK_UP\",\"IsShownOnMap\":true,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false},{\"Name\":\"Tau\",\"ColShapeStr\":\"{\\\"X\\\":-719.8086,\\\"Y\\\":-1325.335,\\\"Z\\\":1.5955810499999998}#2.0#2.0#0.0#true#false#true\",\"PropName\":\"prop_rope_family_3\",\"PropPosition\":{\"X\":-719.8086,\"Y\":-1325.335,\"Z\":0.6291436},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"PICK_UP\",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false},{\"Name\":\"Tau\",\"ColShapeStr\":\"{\\\"X\\\":-790.5565,\\\"Y\\\":-1401.2946,\\\"Z\\\":1.5955810499999998}#2.0#1.0#0.0#true#false#true\",\"PropName\":\"prop_rope_family_3\",\"PropPosition\":{\"X\":-790.5565,\"Y\":-1401.2946,\"Z\":0.63496304},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"PICK_UP\",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false},{\"Name\":\"Tau\",\"ColShapeStr\":\"{\\\"X\\\":-828.0443,\\\"Y\\\":-1399.9486,\\\"Z\\\":1.5955810499999998}#2.0#2.0#0.0#true#false#true\",\"PropName\":\"prop_rope_family_3\",\"PropPosition\":{\"X\":-828.0443,\"Y\":-1399.9486,\"Z\":0.6328217},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"PICK_UP\",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false},{\"Name\":\"Tau\",\"ColShapeStr\":\"{\\\"X\\\":-855.183,\\\"Y\\\":-1350.6882,\\\"Z\\\":1.5955810499999998}#2.0#2.0#0.0#true#false#true\",\"PropName\":\"prop_rope_family_3\",\"PropPosition\":{\"X\":-855.183,\"Y\":-1350.6882,\"Z\":0.63175476},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"PICK_UP\",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false}]'),(150,'Description','Ich hätte aber eine nächste Aufgabe für dich. Ich gehe gerade die Inventurliste durch und mir ist aufgefallen, dass mir noch ein paar Taue für die Boote fehlen, da sie nicht zurückgebracht wurden. Sowie ich unsere Mitglieder kenne, haben sie die Taue bestimmt unten am Steg liegen lassen. Schaue bitte nach und sammel sie gleich ein, sofern du welche findest. Es fehlen mir genau 5 Stück. '),(150,'Name','Lizzy Jones'),(150,'RequiredCollects','5'),(150,'SelectedCollects','5'),(151,'AllOptions','[{\"ItemId\":253,\"MinAmount\":3,\"MaxAmount\":5}]'),(151,'Description','Eine kleine Bitte hätte ich da noch. Unser Getränkelieferant hat leider die bestellten Whiskeyflaschen vergessen und wird heute nicht mehr liefern. Da aber heute Abend die nächste Veranstaltung geplant ist und die meisten Mitglieder eben Whiskey haben möchten, muss ich dich darum bitten, Whiskey zu kaufen und mir zu bringen. Die Kosten für die Flaschen werden wir dir erstatten. '),(151,'Name','Lizzy Jones'),(151,'SelectedAmount','1'),(153,'Description','\"Ja, bitte, Sie wünschen?\" Was, die Hilfskraft? Welcher Job? Was? Ach der Job! Ja, ja, natürlich! Ich stecke gerade in einem sehr wichtigen Experiment. Dabei ist mir ein Stoff ausgegangen, den ich dringend brauche! Sie müssen mir Salzsäure besorgen. Warum stehen Sie noch hier? Ach, wo es das gibt? Was gibt? Salzsäure? Warum fragen Sie mich das? Der Job? Ach der Job! Ja, richtig! \"Schauen Sie im Baumarkt.\"'),(153,'Name','Dr. Sweeney'),(154,'AllOptions','[{\"ItemId\":324,\"MinAmount\":3,\"MaxAmount\":5}]'),(154,'Description','Ich brauche Salzsäure'),(154,'Name','Dr. Sweeney'),(154,'SelectedAmount','1'),(155,'AllCollectables','[{\"Name\":\"Dr. Sweeneys Pflanze\",\"ColShapeStr\":\"{\\\"X\\\":553.0615,\\\"Y\\\":-421.28937,\\\"Z\\\":24.797852}#3.0#3.0#0.0#true#false#true\",\"PropName\":\"p_int_jewel_plant_02\",\"PropPosition\":{\"X\":553.0615,\"Y\":-421.28937,\"Z\":23.829851},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":0.0},\"AnimIdentifier\":\"KNEEL_DOWN \",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false}]'),(155,'Description','Was wollte ich? Ach das Verhältnis zu Salpetersäure nachschauen. Ach 3:1! Na das erklärt, warum die Salzsäure immer leer ist... Sie sind ja immer noch da! Dann können Sie auch nach meiner Pflanze sehen. Das ist schon die zehnte, die mir mein Assistent geschenkt hat. Aber sie hat ein Problem mit meinen Experimenten. Zumindest verlieren diese Pflanzen alle irgendwann ihre grüne Farbe. Wäre ich doch Botaniker geworden... Aber jetzt können Sie ja mal schauen, vielleicht können Sie der Pflanze helfen. Ich würde Sie ja mein Experiment auf meinem Tisch aufbauen lassen, aber diese Glaskolben sind eine zerbrechliche Vorrichtung. Deswegen mache ich das lieber selber. Was stehen Sie noch hier? Gehen Sie nach meiner Pflanze sehen! Ich bezahle Sie... ach das wissen Sie schon. Dann gehen Sie jetzt.\"'),(155,'Name','Dr. Sweeney'),(155,'RequiredCollects','1'),(155,'SelectedCollects','1'),(156,'Description','Ja, hallo? Was wünschen Sie? Was? Meine Pflanze? Welche Pflanze? Ach die Pflanze! Ja, ja natürlich! Ich muss etwas bei der Stadtverwaltung abgeben, aber ich kann jetzt nicht weg. Mein Experiment ist in einem kritischen Stadium, da kann ich nicht einfach gehen! Hey, Sie! Ja, Sie! Können Sie diesen Umschlag bei der Stadtverwaltung abgeben? Ich bezahle Sie auch dafür.\"'),(156,'Name','Dr. Sweeney'),(157,'Description','Ablage für den Umschlag.'),(157,'Name','Stadtverwaltung'),(158,'Description',' \"Notiz für mich, der Stoff muss noch getrocknet werden zur Weiterverarbeitung, aber das nötige Gerät fehlt... Wer sind Sie? Warum stören Sie mich? Achso, Sie haben die Dokumente für mich abgegeben. Bezahlung? Die muss man sich verdienen. Ach das haben Sie? Ja, ja stimmt! Sie könnten noch etwas für mich... Nein. Nein, das können Sie nicht. Den Exsikkator muss ich selber beantragen. Wissen Sie, den brauche ich für den nächsten Schritt mit diesem Stoff, der entzieht Feuchtigkeit und dann kann ich meine Experimente... Moment, sind Sie einer meiner Studenten? Nein, ich kenne Sie nicht. Ach, Sie haben mir geholfen? Dann sollte ich Sie dafür bezahlen. Sie haben einen wichtigen Beitrag zur Wissenschaft geleistet.\"'),(158,'Name','Dr. Sweeney'),(159,'AllOptions','[{\"ItemId\":238,\"MinAmount\":3,\"MaxAmount\":10}]'),(159,'Description','Da jetzt gleich Feierabend ist, kannst du uns ein paar Bier besorgen.'),(159,'Name','Kalle Grabowski'),(159,'SelectedAmount','1'),(160,'AllOptions','[{\"ItemId\":314,\"MinAmount\":3,\"MaxAmount\":10}]'),(160,'Description',' Könntest du mir bitte noch ein paar Sludgies besorgen? Ich brauche jetzt unbedingt etwas mit viel Zucker. Der ganze Stress macht mich so fertig.'),(160,'Name','Jackson Jones'),(160,'SelectedAmount','1'),(161,'Description','Hey du, danke, dass du da bist. Mein Auto wurde geklaut und ich muss dringend Dinge besorgen für die Feier, die ich heute Abend hier veranstalte. Leider sieht es hier aus wie Sau, was ich noch putzen muss. Könntest du für mich einkaufen gehen? Die Auslagen werde ich dir natürlich erstatten.'),(161,'Name','Mary'),(162,'AllOptions','[{\"ItemId\":14,\"MinAmount\":3,\"MaxAmount\":6}]'),(162,'Description','Ich brauche für meinen Apple Pie noch Äpfel. Besorgst du mir ein paar?'),(162,'Name','Mary'),(162,'SelectedAmount','1'),(163,'AllOptions','[{\"ItemId\":226,\"MinAmount\":3,\"MaxAmount\":5}]'),(163,'Description','Danke, dass du mir die Äpfel gebracht hast, aber ich hatte vergessen zu sagen, dass ich auch noch Apfelsaft brauche.'),(163,'Name','Mary'),(163,'SelectedAmount','1'),(164,'AllOptions','[{\"ItemId\":238,\"MinAmount\":3,\"MaxAmount\":6}]'),(164,'Description','Die Jungs haben mich veräppelt. Als sie meinten, dass sie zum Apfelkuchen Apfelsaft trinken möchten, dachte ich wirklich an Saft und nicht an Bier. Daher muss ich dich nochmal losschicken, um ein paar Flaschen Bier zu besorgen.'),(164,'Name','Mary'),(164,'SelectedAmount','1'),(165,'AllOptions','[{\"ItemId\":273,\"MinAmount\":2,\"MaxAmount\":5}]'),(165,'Description','Es ist mir ziemlich unangenehm, aber der Apfelkuchen ist mir im Ofen verbrannt. Jetzt brauche ich schnell eine alternative Lösung. Am besten mache ich ein paar Sandwiches, aber ich habe dafür absolut keine Zeit. Kannst du vielleicht ein paar fertige Sandwiches besorgen?'),(165,'Name','Mary'),(165,'SelectedAmount','1'),(166,'AllOptions','[{\"ItemId\":265,\"MinAmount\":2,\"MaxAmount\":4}]'),(166,'Description','Danke für deine Hilfe, dieser Stress mit dieser verdammten Feier macht mich total fertig. Jetzt habe ich keine Zigaretten mehr, und wenn ich nicht sofort eine rauchen kann, werde ich aggressiv. Daher meine letzte Bitte: Besorge mir bitte ein paar Schachteln Zigaretten.'),(166,'Name','Mary'),(166,'SelectedAmount','1'),(167,'Description','Es hat aber lang gedauert, dass einer kommt.'),(167,'Name','Tracy De Santa'),(168,'AllCollectables','[{\"Name\":\"Müll\",\"ColShapeStr\":\"{\\\"X\\\":-799.90314,\\\"Y\\\":170.06471,\\\"Z\\\":76.72888}#2.052653#2.7293293#0.0#true#false#true\",\"PropName\":\"p_binbag_01_s\",\"PropPosition\":{\"X\":-799.90314,\"Y\":170.06471,\"Z\":76.10335},\"PropRotation\":{\"Roll\":0.0,\"Pitch\":0.0,\"Yaw\":-0.0},\"AnimIdentifier\":\"PICK_UP\",\"IsShownOnMap\":false,\"DestroyedWhenUsed\":true,\"SpawnObjectOnInteract\":false},{\"Name\":\"Müll\",\"ColShapeStr\":\"{\\\"X\\\":-80