ie haben mich einfach suspendiert wegen zu unangemessener Strenge im Dienst. Dabei habe ich dem Kerl aus der Grove nur mal die Spielregeln mit meinem Knüppel erklärt, als er anfing von meiner Mutter zu reden. Naja, egal, nun muss ich Strafdienst ableisten und darf den Dreck vor dem PD-Department aufsammeln. Da ich das aber nicht machen werde, bezahle ich lieber andere dafür, das zu tun. Deshalb viel Spaß.'),(181,'Name','Dave Smith'),(181,'RequiredCollects','7'),(181,'SelectedCollects','7'),(182,'AllOptions','[{\"ItemId\":230,\"MinAmount\":3,\"MaxAmount\":7}]'),(182,'Description','Wo war ich stehengeblieben? Ach ja, während meiner Suspendierung und ohne jegliche Informationen von ihnen, weil sie alle so langsam arbeiten, fühlte ich mich gezwungen, öfter nachzufragen, wie der Stand der Dinge ist. Das Einzige, was ich zu hören bekam, war, dass ich mich per E-Mail an das SD wenden sollte und niemand anderen belästigen sollte. Kannst du das verstehen...? Absolut keine Transparenz in diesem Haufen. Nun ja, ich habe mir schon fast den Mund fusselig geredet. Könntest du mir ein paar Flaschen Wasser besorgen?'),(182,'Name','Dave Smith'),(182,'SelectedAmount','1'),(183,'AllOptions','[{\"ItemId\":238,\"MinAmount\":5,\"MaxAmount\":10}]'),(183,'Description','Kannst du dir vorstellen, was gerade passiert ist? Dieser dumme Collin Jones hat mir per E-Mail meine Kündigung geschickt. Mit dem Zusatz, dass ich in der Exekutive nichts mehr zu suchen habe. Diese Arschlöcher... Na ja, scheiß drauf. Beenden wir einfach die Arbeit, holen uns ein paar Flaschen Bier und die können sich alle ins Knie fi... gehen.'),(183,'Name','Dave Smith'),(183,'SelectedAmount','1'),(184,'Description','Hallo! Schön, dass du mir helfen möchtest. Morgen haben wir eine Veranstaltung, bei der sogar der Bürgermeister anwesend sein wird. Leider ist ein Teil unseres Personals erkrankt, daher bin ich jetzt auf deine Unterstützung angewiesen.'),(184,'Name','Andy Maxwell'),(185,'AllBlueprints','[{\"ColShapeStr\":\"{\\\